    fetch("/members").then(
      res=>res.json()
    ).then(
      data=>{
      setdata(data['arr']);
      console.log('data',data['arr']);
    }
  )
  },[])
  return (
    <div className="App">
    {memberdata.map((datas)=>{
     return (
     <h1>{datas}</h1>
   );
 })}
    </div>
  );
}

export default App;
